// SearchForm.js

import React from 'react';
import TreatmentButtonsList from './TreatmentButtonsList/TreatmentButtonsList';
import Dropdown from './Dropdown/Dropdown'; 
import CalendarDropdown from './CalendarDropdown/CalendarDropdown'; 

const SearchForm = props => {

  return(
    <div className="StartSearch-wrapper">

      {/* Render a TreatmentButtonsList and pass it some props */}
      <TreatmentButtonsList
        labels={props.labels}
        isChecked={props.isActiveArray}
        onClick={props.onClick}
        icons={props.icons}
      />

      {/* Render a Dropdown and pass it some props */}
      <Dropdown // wip: se till att denna ocks책 funkar, forst채tt med att rafaactor och testa
        labels={props.labels}
        chosenLabels={props.activeLabels}
        isChecked={props.isActiveArray}
        onClick={props.onClick}
      />

      {/* Render the CalendarDropdown component that contains a SingleDatePicker */}
      <CalendarDropdown 
        from={props.fromDate}
        to={props.toDate}
        handleDateClick={props.onDatePick}
      />

      {/* Submit Button */}
      <SubmitButton 
        handleClick={this.handleSubmitClick}
      />

    </div>
  )
}

export default SearchForm;
